import React from 'react'; 
import TextareaAutosize from '@material-ui/core/TextareaAutosize';

const Home = () =>{
    return(
        <> 
            {dummy.isLoggedIn && 
            <form encType="multipart/form-data">
                <TextareaAutosize aria-label="어떤일이 있었나요?" 
                rowsMin={3} placeholder="Minimum 3 rows" />     
                
                
                
                
                
            </form>}
        </>
    )
}

export default Home;
